  Listing.where(title: "2013 Dodge Avenger", description: "999Our athletic Clean CarFax 2013 Dodge Avenger SE shown in Redline 2-Coat Pearl over light interior offers a bold, muscle car-like look to the mid-size sedan buyer like you. Powered by a proven 2.4 Liter 4 Cylinder offers 173hp while tethered to a responsive Automatic transmission that offers smooth shifts and plenty of passing power. The suspension on this Front Wheel Drive is taut and the road is dampened with sound deadening elements from the factory for a richer ride down the road while seeing near 31mpg.   Slip inside this family sedan that is cleverly disguised as a muscle car and you will be greeted by ambient lighting and a premium soft-touch interior. Features abound in the Avenger offer plenty of happiness for everyone!   Dodge has loaded this one up with safety features to put your mind at ease. Included in our Avenger are plenty of airbags plus Electronic Stability Control system with traction control and anti-lock brakes. It is even an IIHS top safety pick and like all Dodge, products have exceptional value in the safety department. If you've got dreams of driving a muscle car, but need a car for the whole family, our Avenger SE is the most brute looking option you'll find. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!   We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2013, miles: 80080, transmission: "Automatic", color: "Maroon", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 6975, newused: "Used", vin: "1C3CDZAB1DN643427", stocknumber: "CCSJ187", model: "Avenger", trim: "SE", enginedescription: nil, interiorcolor: "Black Interior", options: "Audio : Auxiliary Audio Input,Audio :