  Listing.where(title: "2006 Ford Explorer", description: "Our 2006, One Owner Clean Carfax, Ford Explorer comes in Oxford White on Tan interior. The 4.0 Liter V6 offers 210hp while connected to a smooth shifting 5 Speed automatic transmission to help this rear drive SUV manage the road.   With the Explorer, Ford has shown just how good they are at getting the basics right. They understand that today's customer is keenly aware of all the choices in this segment, and that the customer wants more goodies for the money. Print this page and call us NOW for your personalized test drive towards ownership!", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2006, miles: 104959, transmission: "Automatic", color: "Oxford White", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 7875, newused: "Used", vin: "1FMEU72E46UA65068", stocknumber: "IAUN157", model: "Explorer", trim: "XLS", enginedescription: nil, interiorcolor: "Tan", options: "Am/Fm 80-Watt Stereo W/Cd/Mp3,Audio : Am/Fm Stereo,Audio : Cd Player,Audio : Mp3 Player,Convenience : Power Outlet,Convenience : Variable Speed Intermittent Wipers,Locks : Keyless Entry,Locks : Power Door Locks,Pwr Windows-Inc: \"One-Touch-Down\" Driver Window,Safety Features : Stability Control,Safety Features : Traction Control,Seats : Bucket Seats,Seats : Rear Bench Seat,Window : Power Windows,Window : Privacy Glass", imagefront: nil, imageback: nil, imageleft: nil, imageright: nil, frontinterior: nil, rearinterior: nil, bodytype: nil, make: "Ford", approved: true, expiration_date: "2218-01-03 01:44:43", external_url: true, external_image: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176070/20180205181208862_bdc87809f10b499386c65435de6f959f.jpg", external_imagefront: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/176070/20180205181209292_2148e63c329f490