  Listing.where(title: "2001 Ford Explorer Sport", description: "Meet our 2001 Ford Explorer Sport in Gold over tan interior and see that it is roomy and comfortable. Powered by a strong 4.0 Liter V6 that offers 203hp while matched with a 5 Speed Automatic transmission.   Our Sport trim rides smoothly handles well, and the interior packaging is fantastic. It's a great SUV for long trips as well as trafficking through the suburban jungle! Five people ride with ease with so many amenities. Enjoy comfortable leather seating, high-end audio and multi function steering wheel.   This is one that just must be checked out! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2001, miles: 135325, transmission: "Automatic", color: "Harvest Gold Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 3575, newused: "Used", vin: "1FMYU60E31UC09678", stocknumber: "JCSQ67", model: "Explorer Sport", trim: nil, enginedescription: nil, interiorcolor: "Medium Prairie Tan", options: "5-Passenger Seating,Air Bag - Frontal : Driver Air Bag,Air Bag - Frontal : Passenger Air Bag,Audio : Am/Fm Stereo,Audio : Cassette,Audio : Cd Player,Child Safety Rear Door Locks,Convenience : Power Outlet,Convenience : Variable Speed Intermittent Wipers,Front 12-Volt Pwr Point,Front Adjustable-Height Shoulder Safety Belts,Front/Rear Outboard 3-Point Safety Belts,Pwr Windows-Inc: \"One-Touch-Down\" Driver Window,Securilock Passive Anti-Theft System,Side Door Intrusion Beams", imagefront: nil, imageback: nil, imageleft: nil, imageright: nil, frontinterior: nil, rearinterior: nil, bodytype: nil, make: "Ford", approved: true, expiration_date: "2218-01-03 01:44:43", external_url: true, external_image: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos