  Listing.where(title: "1997 Ford Explorer", description: "With ample power and space, our 1997 Ford Explorer XL is terrific in Gold on Tan interior! The 4.0 Liter V6 offers plenty of power for about anything. Enjoy the control right in the palm of your hand and offer a confident ride while yielding near 20mpg.  Explorer XL is agile, rugged, and ready for you to hook up your boat and head for the lake. Plenty of cargo space ensures you can fit all your gear for hunting, camping or anything you choose! The AM/FM stereo, supportive and durable seating, air conditioning, and other features make each ride feel amazing.  Airbags, ABS, and an over-all quality build keep you feeling confident with each drive. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 1997, miles: 151040, transmission: "Automatic", color: "Light Prairie Tan (CC/Met)", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 2775, newused: "Used", vin: "1FMDU32E2VZC30329", stocknumber: "ICSJ87", model: "Explorer", trim: "XL", enginedescription: nil, interiorcolor: "Medium Prairie Tan", options: "12-Volt Pwr Point,4 Load Floor Tie-Down Hooks,Air Bag - Frontal : Driver Air Bag,Air Bag - Frontal : Passenger Air Bag,Air Conditioning : A/C,Audio : Am/Fm Stereo,Convenience : Intermittent Wipers,Convenience : Power Outlet,Front Dome/Map Lights W/Dual Door/Liftgate Courtesy Switches,Illuminated Entry,Matching Split-Folding Rear Seat W/Headrest & \"Fold Flat\" Feature,Safety Features : Child Safety Locks,Seats : Rear Bench Seat,Steering : Power Steering,Three Grab Handles", imagefront: nil, imageback: nil, imageleft: nil, imageright: nil, frontinterior: nil, rearinterior: nil, bodytype: nil, make: "Ford", approved: true, expiration_date: "2218-01-03 01:44:43", external_url