  Listing.where(title: "1999 Saturn SC 3dr", description: "Meet our great looking 1999 Saturn S-Series SC in Silver over light interior and find it to be an exceptional 3 Door Coupe. Powered by an efficient 1.9 Liter 4 Cylinder that offers 100hp for robust passing power while connected to a fun to drive Automatic transmission. This Twin Cam Front Wheel Drive Saturn will get you to your destination with ease thanks to variable effort steering and a sporty suspension.   Inside this SC find comfortable bucket seating, easy to read gauges, a rocking AM/FM stereo, power steering, adjustable steering wheel.   Packed full of safety features from General Motors, this Saturn is ready to work for you. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 1999, miles: 84841, transmission: "Automatic", color: "Gray", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 3375, newused: "Used", vin: "1G8ZP1286XZ299702", stocknumber: "AASJ108", model: "SC 3dr", trim: nil, enginedescription: nil, interiorcolor: "Gray", options: "3-Way Dome Light,60/40 Split Fold-Down Rear Seatbacks,Convenience : Adjustable Steering Wheel,Convenience : Intermittent Wipers,Heat/Ventilation System W/4-Speed Fan, Defroster,Instrument Panel Gauges-Inc: 110 Mph Speedometer W/Trip Odometer, 7000 Rpm Tachometer, Coolant Temp, Fuel Level, Low Fuel Light,Passenger Visor Vanity Mirror,Rear Seat Console W/2 Cupholders/Storage,Remote Hood/Trunk Lid/Fuel-Filler Door Releases,Seats : Bucket Seats,Seats : Pass-Through Rear Seat,Seats : Rear Bench Seat,Steering : Power Steering,Warning Chimes-Inc: Headlamps-On/Key-In-Ignition/Driver Seat Belt,Window : Rear Defrost", im