  Listing.where(title: "2010 Dodge Nitro", description: "Those who enjoy rugged looks, good value, and a capable all-weather vehicle around town will fall in love with our One Owner Clean Carfax 2010 Dodge Nitro SE. This mid size SUV is pure Dodge with its distinctive look and Dodge capabilities. Our Rear Wheel Drive Nitro comes with loads of power that comes from a reliable 210hp, 3.7 Liter V6 and a 4 speed Automatic transmission for a peppy, yet smooth ride.  Because of its high stance and truck like frame, this Nitro looks and feels larger than it really is, giving it a solid drive and plenty of cargo and passenger space. This SUV will comfortably the whole family, plus it has plenty of room for whatever you are hauling! Take a look at our pictures and feature list. You will see that this one is full of comfort and safety for the whole family.  Gorgeous inside and out - Great power - Fantastic safety features - All that's missing is you! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2010, miles: 59762, transmission: "Automatic", color: "Inferno Red Crystal Pearl", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 10475, newused: "Used", vin: "1D4PT2GK1AW150158", stocknumber: "CASJ058", model: "Nitro", trim: "SE", enginedescription: nil, interiorcolor: "Dark Slate Gray", options: "12V Auxiliary Pwr Outlet,4-Wheel Anti-Lock Pwr Disc Brakes,Active Head Restraints,Air Bag - Frontal : Driver Air Bag,Air Bag - Frontal : Passenger Air Bag,Air Bag - Frontal : Passenger Air Bag Sensor,Audio : Auxiliary Audio Input,Audio : Cd Player,Audio : Mp3 Player,Convenience : Power Outlet,Latch-Ready Child Seat Anchor System,