  Listing.where(title: "2011 Kia Soul", description: "Get behind the wheel of our fun to drive Clean Carfax 2011 Kia Soul Hatchback shown in Molten Red! Powered by an efficient 2.0 Liter 4 Cylinder generating 142hp on demand while tethered to a 4 Speed Automatic transmission. This Front Wheel Drive Soul will provide stability and traction control while offering near 30mpg on the open road. The exterior boasts privacy glass, attractive wheels, and power heated mirrors.  Our Soul trim offers a well-built cabin with features galore. The premium cloth seating with Soul graphics is roomy enough to seat five comfortably and the split-folding rear seat allows for ultimate versatility. Features include an AM/FM/CD audio system with available Satellite radio, USB/auxiliary input jack, Bluetooth hands-free connectivity, cruise and audio controls on the leather-wrapped steering wheel, and remote keyless entry.  Kia has your safety in mind with a plethora of advanced safety features such as six airbags, ABS, electronic stability control and a tire-pressure monitoring system. Make your everyday commute a little bit brighter with this Soul. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2011, miles: 100611, transmission: "Automatic", color: "Molten", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 7775, newused: "Used", vin: "KNDJT2A24B7196087", stocknumber: "DCSJ098", model: "Soul", trim: "+", enginedescription: nil, interiorcolor: "Black seat trim", options: "Anti-Lock Brakes (Abs) -Inc: Electronic Brake-Force Distribution (Ebd), Brake Assist (Ba),Audio : Auxiliary Audio Input,Audio : Cd Player,Audio : Mp3 Player,Audio