  Listing.where(title: "2007 Honda Ridgeline", description: "Our 2007 Honda Ridgeline RTL shown in Formal Black is a sporty multi-purpose truck and a top seller for Honda thanks to its car-like ride and SUV flexibility. The truck also has a few unique features, like a lockable trunk under the cargo bed. Our Four Wheel Drive Ridgeline has a 3.5L V6 that delivers 247hp and 245lb-ft of torque. Honda's all wheel drive system with 5-Speed automatic will haul the camper to the hills or the boat to the lake. Its road manners are sporty and well-controlled, and the ride is very cushioned for a truck. Honda intended the Ridgeline to balance car-like attributes and truck convenience.  Our top level fully-equipped RTL adds dual-zone climate control, leather heated seats, and even a sunroof, to a long list of other features. The interior is spacious, and it offers a 60/40 folding rear seat and several storage compartments. The 60-inch bed is actually quite wide, allowing for a bit more loading flexibility than many midsized pickups. With you and yours in mind, it also comes standard with a comprehensive list of safety features, including traction control, stability control, ABS with brake assist, and airbags all around you.  If you're contemplating a multi-use or commuter pickup, our 2007 Honda Ridgeline should top the shopping list... Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2007, miles: 140440, transmission: "Automatic", color: "Formal Black", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 9975, newused: "Used", vin: "2HJYK16557H547885", stocknumber: "DCSJ058", model: "Ridgeline", trim: "RTL w/Leather", engine