  Listing.where(title: "2000 Oldsmobile Alero", description: "This good-looking Clean Carfax 2000 Alero GL3 sedan displayed in Silver Mist is ready and waiting for you. And as good-looking as it is, you'll never want for muscle. Our Alero has a big 170 hp, 3.4 Liter V6 mated to a smooth-shifting 4 Speed Automatic transmission.   The cloth seating look and feels high class and you'll have all the convenience features anyone could want. It's a safe car too, with good crash ratings and ABS brakes. Check out our pictures to see the incredible value that our 2000 Alero represents!   Here's a unique chance to own a piece of American auto tradition that will pamper you and save you money at the same time. Come look at this great car before it gets away! Print this page and call us Now...We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2000, miles: 73227, transmission: "Automatic", color: "Silver Mist", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 3775, newused: "Used", vin: "1G3NL52E0YC328774", stocknumber: "DCSJ158", model: "Alero", trim: "GL3", enginedescription: nil, interiorcolor: "Pewter", options: "2-Auxiliary Pwr Outlets,Air Conditioning : A/C,Convenience : Power Outlet,Convenience : Remote Trunk Release,Driver & Front Passenger Airbags,Locks : Power Door Locks,Microchip Encoded Key Passlock Ii Vehicle Theft-Deterrent System,Pwr Windows W/Driver-Side Auto-Down,Rear Child-Security Door Locks,Rear-Window Grid Antenna,Seats : Bucket Seats,Seats : Pass-Through Rear Seat,Steering : Power Steering,Window : Power Windows,Window : Rear Defrost", imagefront: nil, imageback: nil, imageleft: nil, imageright: nil, frontinterior: nil, rearinterior: nil,