  Listing.where(title: "2010 Jeep Patriot", description: "Let us introduce our 2010 Jeep Patriot Sport 4x4 in Sunburst Orange Pearl. Powering this machine is a 2.4 Liter 4 Cylinder that produces 170hp. Handling and maneuverability are some of this Four Wheel Drive Patriots many strengths, along with good communicative steering, clearly defined corners, plus it's easy to park--and it fits into small spaces, also thanks to its compact-car size.  This Patriot's interior is basic yet attractive and sturdy-looking. There's an abundance of hard plastic, but it fits the Patriot's very purposeful design, and it looks like it would clean up well. Seating is well laid out, there's plenty of headroom in front plus plenty of head and legroom in back for adults.   Safe and city-friendly, yet tough enough for weekend camping, this Jeep Patriot has a lot going for it. You owe it to yourself to take a look at this one. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2010, miles: 127367, transmission: "Automatic", color: "Sunburst Orange Pearl", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 6875, newused: "Used", vin: "1J4NF2GB5AD577876", stocknumber: "DCSJ028", model: "Patriot", trim: "Sport", enginedescription: nil, interiorcolor: "Dark Slate Gray", options: "Air Conditioning : A/C,Audio : Auxiliary Audio Input,Audio : Cd Player,Audio : Mp3 Player,Child Safety Rear Door Locks,Convenience : Power Outlet,Multistage Dual Front Airbags,Pwr Accessory Delay,Safety Features : Brake Assist,Safety Features : Child Safety Locks,Safety Features : Stability Control,Safety Features : Traction Control,Seats : Bucket Seats,Steering : P