  Listing.where(title: "2004 GMC Yukon Denali", description: "Big is AWESOME, and our Clean Carfax 2004 GMC Yukon Denali AWD offers a wealth of features in a big, comfortable luxury SUV! This beauty has plenty of power under the hood thanks to the 6.0 Liter V8 engine that cranks out 325 horsepower and 365 lb.-ft. of torque. Coupled with a smooth shifting automatic this All Wheel Drive brings muscle to the road and delivers power to all 4 wheels!  Our Denali trim certainly has all the creature comforts the most pampered soccer mom would ever need: leather seats with 1st and 2nd row heated seats, leather wrapped steering wheel with audio and driver information center controls, sunroof, trizone climate control, AM/FM stereo, CD/Cassette player, navigation, premium audio, power accessories, and so much more! The outside of our Denali features stylish aluminum wheels, roof mounted luggage rack, power heated mirrors, and privacy glass.  Standard safety features like ABS, automatic stability control, and multiple airbags are on board to carry your precious cargo safely to their destination. This gorgeous Yukon Denali has it all and is waiting for you! Print this page and call us Now...We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2004, miles: 116661, transmission: "Automatic", color: "Polo Green Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 9999, newused: "Used", vin: "1GKEK63U14J177162", stocknumber: "ECSJ068", model: "Yukon Denali", trim: nil, enginedescription: nil, interiorcolor: "Sandstone", options: "Air Conditioning : Multi-Zone A/C,Air Conditioning : Rear A/C,Audio : Cd Changer,Audio : Premium Sound System,Audio : Rear Seat Au