  Listing.where(title: "2006 Chrysler 300", description: "The styling of our Clean Carfax 2006 Chrysler 300 Touring in Silver Steel Metallic is distinctive and its interior is roomy and efficient. Powered by a 3.5 Liter V6 producing 250hp when connected to a smooth-shifting 4 Speed Automatic transmission. This Rear Wheel Drive will deliver you to your choice of destinations in comfort and style while scoring 27mpg on the highway.  Our 300 is clearly bold and sleek but mostly the styling is uncompromising and makes no apologies. The sedan's roofline beautifully complements the lines which are long, low and carved. The interior matched the styling of the exterior with a plush leather interior, power driver's seat, an outstanding audio system complete with an in-dash CD changer. All your friends and family won't be able to stop gawking at your new ride!   Antilock brakes with emergency brake assist, electronic stability, and traction control are also on board, picking up sensibility as well as safety. When you are competing in the sedan market, you better bring your A game. Our Chrysler 300 does just that. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2006, miles: 127914, transmission: "Automatic", color: "Silver Steel Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 6875, newused: "Used", vin: "2C3LA53G46H177966", stocknumber: "ECSJ088", model: "300", trim: "Touring", enginedescription: nil, interiorcolor: "Slate/Graystone", options: "60/40 Split-Folding Rear Seat,Audio : Cd Player,Convenience : Power Outlet,Locks : Keyless Entry,Locks : Power Door Locks,Pwr Trunklid Release,Rear Door Child Protect