  Listing.where(title: "2013 Nissan Versa", description: "Want to go green but hate the thought of breaking the bank on a new hybrid? Look no further than the Clean CarFax 2013 Nissan Versa 1.6 S Plus Sedan. The 1.6 S Plus shown in Titanium is the first vehicle in North America to wear the PureDrive badge, meaning it exceeds the industry average Federal CAFE fuel economy requirements for 2016! The spunky 1.6 Liter 109hp 4 Cylinder is mated to Nissan's next generation Xtronic CVT and together accomplish an impressive 40mpg on the open road.   Take a look at our pictures, and you'll notice the unusually roomy interior is both well built and packed with useful features. You will find air conditioning, a trip computer, a tilt steering wheel, an AM/FM/CD audio system, an auxiliary 12-volt DC power outlet as well as a plethora of bottle and cup holders throughout.   Dual stage front airbags, side-impact airbags and roof-mounted curtain side-impact airbags are all there to keep you out of harms way in the event of an accident. To help prevent an accident, the Versa is equipped with Vehicle Dynamic Control, a Traction Control System as well as a Tire Pressure Monitoring System. These features work so well together, the Versa has been awarded a Top Safety Pick by the Insurance Institute for Highway Safety. It's time to make your daily commute greener, for both you and the environment. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2013, miles: 74414, transmission: "Automatic", color: "Titanium Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 6775, newused: "Used", vin: "3N1CN7AP4DL891747", stocknumber: "EC