  Listing.where(title: "2010 Chrysler 300", description: "An attention-grabbing exterior, an incredible driving experience, and a powerful V6 engine should put our Clean Carfax 2010 Chrysler 300 in Black Crystal Pearl near the top of your short list. This powerhouse boasts a 3.5 Liter V6 that throws out 250hp for loads of get up and go. Coupled with a smooth shifting 4-Speed automatic transmission, this Rear Wheel Drive evens out the bumps and cracks in the road, earning a pleasing 25mpg highway.  Our upscale Touring will reward you with comfort, amenities, safety features, performance, and a certain social status that will be the envy of the neighborhood. Check out the incredible audio system with CD/MP3 and auxiliary input, a full complement of power accessories, heated mirrors, stability assist, brake assist, power adjustable pedals, and more. Yes, our pictures of this 300 are nice, but you've got to see this gorgeous sedan in person!  Bottom line, this Chrysler 300 sedan turns heads simply with its bold yet refined styling. Add to that a boatload of features; a smooth, comfortable ride; and a powerful engine, and the result will be almost legendary. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2010, miles: 99311, transmission: "Automatic", color: "Brilliant Black Crystal Pearl", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 7775, newused: "Used", vin: "2C3CA5CV9AH105166", stocknumber: "DCSJ248", model: "300", trim: "Touring", enginedescription: nil, interiorcolor: "Dark Slate Gray", options: "Air Conditioning : Multi-Zone A/C,Audio : Auxiliary Audio Input,Audio : Cd Player,Audio : Mp3 Player,Audio :