  Listing.where(title: "2005 Ford F-150", description: "Get behind the wheel of our Clean Carfax 2005 Ford F-150 XLT SuperCrew in Dark Shadow Metallic! Powered by a 5.4 Liter V8 generating plenty of power when mated to a 4 Speed Automatic transmission. You can expect this Rear Wheel Drive Ford to secure nearly 18mpg on the open road. Ready for work or play our F-150 shows off a bold stance with chrome bumpers, a chrome grille, alloy wheels, and privacy glass.  This XLT SuperCrew boasts comfortable cloth seating and many other amenities. Turn up the AM/FM stereo with a CD player, set the cruise control as you grip the leather-wrapped steering wheel and take off! Other creature comforts include power accessories, air conditioning, smart storage spaces, and plenty of legroom for you and your passengers!   This Ford is an absolute class leader when it comes to safety, comfort, and handling. With ABS, plenty of airbags, and the confidence of Four Wheel Drive, you won't need to worry about the safety of you or your passengers. Our Ford F-150 XLT delivers a combination of style, interior comfort, and performance, that's hard to beat. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2005, miles: 127757, transmission: "Automatic", color: "Dark Shadow Grey Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 11275, newused: "Used", vin: "1FTPW12515FB17151", stocknumber: "ECSJ158", model: "F-150", trim: "XLT", enginedescription: nil, interiorcolor: "Flint", options: "2Nd Row Grab Handles,Air Conditioning : A/C,Audio : Cd Player,Convenience : Power Outlet,Fade-To-Off Interior Lighting,Gauges-Inc: Voltmeter, Oil Pre