  Listing.where(title: "2007 Chrysler Aspen", description: "Our 2007 Chrysler Aspen in Cognac Crystal Pearl Coat shares many of the Dodge Durango's attributes, including platform and Dodge's sturdy body-on-frame truck design. Styling is what separates the two SUVs, as Chrysler has finished their new SUV with its own luxurious identity. This Aspen sports a 5.7 Liter V8 that has loads of pep and delivers 345hp.  On the inside, a full complement of comfort and convenience features are standard. Take a look at the list. Can you say family road trip? More great news...In NHTSA crash tests, this Aspen earned five stars for driver and front-passenger protection.   This Aspen is a luxurious machine that is just bad to the bone on power and personal amenities. So, help us make this one yours today. Print this page and call us Now...We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2007, miles: 77407, transmission: "Automatic", color: "Cognac Crystal Pearl Coat", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 9575, newused: "Used", vin: "1A8HX58227F510321", stocknumber: "ECSN198", model: "Aspen", trim: "Limited", enginedescription: nil, interiorcolor: "Dark Khaki/Graystone", options: "Air Conditioning : Rear A/C,Audio : Auxiliary Audio Input,Cargo Tie-Down Loops,Convenience : Power Outlet,Convenience : Security System,Convenience : Steering Wheel Audio Controls,Convenience : Universal Garage Door Opener,Locks : Keyless Entry,Locks : Power Door Locks,Luxury Tilt Steering Wheel W/Audio Controls,Pwr Front Windows W/One-Touch Up/Down,Seats : 3Rd Row Seat,Security Alarm,Sentry Key Theft Deterrent System,Universal Garage Door Opener", imagefront: nil, imageba