  Listing.where(title: "2002 Chevrolet Tahoe", description: "Our One Owner 2002 Chevrolet Tahoe in Victory Red is one very sweet ride. With smooth suspension, this beauty feels like it is gliding on glass. Under the hood you'll find a 5.3 Liter Flex Fuel V8 powering out 285hp. Paired with a 4-Speed automatic, this four wheel drive is not fazed by any weather, towing, or hauling.  This Tahoe LT includes leather throughout, a sunroof, AM/FM stereo, automatic headlights, plenty of room and more! With lots of power on this beautiful SUV, you can travel in safety, comfort and true style!   Edmunds wrote, \"...One of the best full-size SUV's on the market.\" What more do you need to know? Come on - you know you want this one! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2002, miles: 140570, transmission: "Automatic", color: "Victory Red", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 7375, newused: "Used", vin: "1GNEC13T32R160193", stocknumber: "FCSJ058", model: "Tahoe", trim: "LT", enginedescription: nil, interiorcolor: "Tan/Neutral", options: "Audio : Cd Player,Audio : Premium Sound System,Audio : Rear Seat Audio Controls,Convenience : Luggage Rack,Convenience : Power Outlet,Convenience : Security System,Convenience : Universal Garage Door Opener,Driver & Front Passenger 8-Way Pwr Seats,Enhanced-Performance 9-Speaker Sound System W/Subwoofer,Homelink Universal Garage Door Opener,Locks : Keyless Entry,Locks : Power Door Locks,Pwr Windows-Inc: Driver Lockout Switch,Running Boards : Running Boards/Side Steps,Seats : Heated Front Seat(S)", imagefront: nil, imageback: nil, imageleft: nil, imageright: nil, fronti