  Listing.where(title: "2013 Chevrolet Sonic", description: "Our Clean Carfax 2013 Chevrolet Sonic LT announces its presence in stunning Crystal Red Tintcoat and this sedan is primed to tame winding roads. Powered by our high tech 1.8 Liter, our Sonic kicks up 138hp and zips down the road using its smooth shifting 6 Speed Automatic transmission. Firm and agile suspension straightens twisting roads thanks to a suspension system designed by the Corvette team. This brings elite engineering to an affordable Front Wheel Drive machine that scores over 35mpg on the highway.  Admire our refined cabin, dive into our swooping exterior and revel in our dashing rear spoiler. Our pictures let you imagine yourself sliding into the comfy driver seat, the bright digital speedometer greeting you, and our technology allowing you to rock out to tunes on your device or satellite radio. You will be a head-turner with chrome moldings and auto on-off halogen headlamps as you cruise by with your premium 6 speaker system wailing.  Our roomy, versatile sedan easily carries a snowboard plus a full days purchases. Additionally, Chevrolet supplies 10 air bags for you and is a top safety pick. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2013, miles: 84806, transmission: "Automatic", color: "Crystal Red Tintcoat", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 5999, newused: "Used", vin: "1G1JC5SG5D4224665", stocknumber: "FCSJ068", model: "Sonic", trim: "LT", enginedescription: nil, interiorcolor: "Jet Black/Dark Titanium", options: "Audio : Auxiliary Audio Input,Audio : Mp3 Player,Audio : Satellite Radio,Audio : Smart Device Integra