  Listing.where(title: "2004 Jeep Grand Cherokee", description: "If you are looking for a Great SUV LOADED with luxury options at a Great Price, This is it! Our One Owner, Clean Carfax 2004 Jeep Grand Cherokee Overland 4x4 is Numero Uno in stylish comforts and elegant off-roading. Our 2004 model comes power packed with a strong 4.7 Liter overhead-valve V8 that develops 265hp and comes with a five-speed automatic transmission. And that's just the beginning.   The cabin is extra inviting, the performance is top-notch, and the safety ratings are 5-Star across the board. Our Overland's real claim to fame is its level of luxury. Aside from the exterior facelift this '04 model gets, you have an interior that's 360 degrees of comfort and convenience. Check out our pictures and you'll see all of the luxury that this Overland has, including leather upholstery with heated front seats, sunroof, and more!  Drivers applaud this 2004 Jeep Cherokee Overland, and you will too. Don't hesitate on this one! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2004, miles: 164287, transmission: "Automatic", color: "Bright Silver Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 6775, newused: "Used", vin: "1J8GW68J24C366469", stocknumber: "FCSJ078", model: "Grand Cherokee", trim: "Overland", enginedescription: nil, interiorcolor: "Dark Slate Gray", options: "Audio : Cd Changer,Audio : Premium Sound System,Convenience : Cargo Shade,Convenience : Power Outlet,Convenience : Rain Sensing Wipers,Convenience : Security System,Convenience : Steering Wheel Audio Controls,Leather Wrapped Steering Wheel W/Wood Trim,Locks : Keyless En