  Listing.where(title: "2011 Ford Fusion", description: "Tech Savvy meets Style describe our 2011 Ford Fusion SEL Sedan presented in amazing Red Candy Metallic. Powered by a proven 3.0 Liter V6 offering a 240hp while connected to a durable 6 Speed SelectShift Automatic transmission that generates 28mpg on the open road while having a seating capacity of five. This Front Wheel Drive sedan has a sporty look with 17-inch 5 spoke machined aluminum wheels, bright chrome 3-bar grille, fog lights, single exhaust with dual chrome tips, SecuriCode keyless entry keypad, and solar tinted windows.  Settle into comfortable leather trimmed seating as you enjoy the sweet sounds coming from your 6-speaker audio system with CD, MP3 capability and available satellite radio. Power, heated driver's and passenger's seats, sunroof, ambient lighting, convenient steering wheel mounted cruise and audio controls, Ford SYNC voice-activated in-vehicle connectivity system plus MyKey to set alerts, and 60/40 split-fold rear seat enhance the interior of our Ford Fusion SEL.  Ford always makes safety a priority with several airbags, electronic stability control, anti-lock brakes and SOS post crash alert give peace of mind to you and your passengers. This smart and dependable Fusion delivers on every level! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership!", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2011, miles: 119381, transmission: "Automatic", color: "Red Candy Metallic Tinted", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 6775, newused: "Used", vin: "3FAHP0JG1BR305817", stocknumber: "FCSN088", model: "Fusion", trim: "SEL", enginedescription: nil, interiorcolor: "Charcoal Black", options: "Air Conditioning : Multi-Zone A/C,Audio : Cd Player,Audio : Mp3 Player,Audio : Satellite Radio,Conveni