  Listing.where(title: "2008 Nissan Titan", description: "Ready for adventure, our Clean Carfax 2008 Nissan Titan King Cab XE in Radiant Silver Metallic is big and powerful. Under the hood sits a 5.6 Liter V8 that offers 317hp while connected to a durable 5 Speed Automatic. Combined with incredible towing potential, this Rear Wheel Drive machine can help you own the road while looking good!   Inside our XE, enjoy air conditioning and upscale audio with CD Player. With seating for up to six, yes six people, you have room to stretch out! There are lots of storage compartments, including an armrest console with the front bench seat. Interior room is spacious, with the Crew Cab featuring 180-degree rear doors for easier passenger or loading access.   Drivers of this Nissan Titan praise its power, pickup, and safety while providing the heft of a truck, it handles a lot like a car which you will enjoy. Other highlights include the styling, the Utili-track, and the roominess! So if you love this as much as others do, Print this page and call us NOW for your personalized test drive towards ownership. We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2008, miles: 114310, transmission: "Automatic", color: "Radiant Silver Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 8875, newused: "Used", vin: "1N6AA06E28N301191", stocknumber: "FCSN098", model: "Titan", trim: "XE", enginedescription: nil, interiorcolor: "Charcoal", options: "2Nd Row Fold-Up Split Bench Seat,3-Point Alr/Elr Passenger Seat Belt System For Outboard Seating Positions & Rear Center Seating Position,Air Conditioning : A/C,Audio : Cd Player,Cloth 40/20/40 Split Bench Front Seat,Convenience : Power Outlet,Driver & Front Passenger Airbags W