  Listing.where(title: "2002 Jeep Liberty", description: "Our One Owner, Clean Carfax 2002 Jeep Liberty Sport in Patriot Blue Pearl is a great SUV and is waiting just for YOU. Of course, it is also ready to climb mountains if you so desire! Our Rear Wheel Drive Liberty boasts a 3.7 Liter V6 engine with enough power to tackle the world.   With Jeep's long-standing reputation, our Liberty is ready to go... highway cruisin'... or city driving! Hit the campsite or the little league game in style! No matter where you go, our Jeep is sure to turn heads!   Safety is taken care of as well. Plenty of airbags, front and rear anti-roll bars, and more are in place to keep you safe.ou have to see this Liberty to believe it! How?? Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2002, miles: 72928, transmission: "Automatic", color: "Patriot Blue Pearl", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 5775, newused: "Used", vin: "1J4GK48KX2W298962", stocknumber: "FCSJ028", model: "Liberty", trim: "Sport", enginedescription: nil, interiorcolor: "Dark Slate Gray", options: "3-Point Seat Belts All Seating Positions,65/35 Split Fold Down Rear Seat,Convenience : Power Outlet,Convenience : Variable Speed Intermittent Wipers,Driver & Front Passenger Multi-Stage Airbags,Driver & Passenger Assist Handle,Halogen Headlamps W/Time Off Delay,Latch-Ready Child Seat Anchors,Rear Swing Gate W/Flipper Glass,Seats : Bucket Seats,Seats : Pass-Through Rear Seat,Steering : Power Steering,Tire - Front : Tires - Front All-Season,Tire - Rear : Tires - Rear All-Season,Window : Rear Defrost", imagefront: nil, imageback: nil, imageleft: nil, imagerig