  Listing.where(title: "2004 Dodge Ram 1500", description: "Your search can end today... This is the truck for you! Feast your eyes on our beautiful Clean Carfax 2004 Dodge Ram SLT Crew Cab, sporting polished wheels, bed liner, and Dodge's squared-off and aggressive grille. If you are looking for power, look no further. This 5.7 Liter V8 has it for you, powering out 345hp and scoring 18mpg highway. Coupled to a smooth shifting Automatic transmission, this Rear Wheel Drive would be great for trips to the hardware store or a stump-pulling work machine with a kiss of comfort.   This SLT trim Crew Cab offers a list of nice amenities, such as cloth seating, cruise on the wheel, an AM/FM/CD stereo, dual climate control, full power accessories, and much more. This clean machine will more than meet the needs of hunters and weekend project warriors.  Safety tops Dodge's concerns, so rest easier knowing that ABS and next generation airbags are all in place. Our Dodge will get any job done! Drives like new - smooth and straight. You will not be disappointed in this truck. So like we said, look no further... Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2004, miles: 90885, transmission: "Automatic", color: "Graphite Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 10575, newused: "Used", vin: "1D7HA18D44S542747", stocknumber: "ECSN178", model: "Ram 1500", trim: "SLT", enginedescription: nil, interiorcolor: "Taupe", options: "12V Pwr Outlet,Air Conditioning : A/C,Audio : Cd Player,Convenience : Power Outlet,Convenience : Variable Speed Intermittent Wipers,Floor Carpeting,Front Floor Mats,Locks : Keyless Entry