  Listing.where(title: "2005 Nissan Pathfinder", description: "Our Clean Carfax Nissan Pathfinder shown in Storm Gray Metallic goes through a rite of passage in 2005, leaving the kiddie pool to join the big boy SUVs during adult swim. Its power comes from a 270hp 4.0 Liter V6 that can tow up to 6,000 pounds and it sports a new 5 Speed Automatic transmission. This Pathfinder 4x4 gets bigger by six inches and is more powerful. Its length means it now offers three rows of seats for the first time. Built on the truck-based platform of the Armada and Titan, the Pathfinder has a lot more surface muscle to match what's under the hood. A new rear independent suspension is supposed to improve handling, making it feel less like a truck.  This one is fully loaded with power locks and windows, sunroof, rear DVD system and more. The whole family will enjoy the ride!  You will find a myriad of safety features with ABS brakes, stability/traction control, and dual front airbags. Both second and third rows fold flat to expand on the cargo space (16 cubic feet) when the seats are up but don't forget that you have tons of room to live with. Don't wait. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2005, miles: 205491, transmission: "Automatic", color: "Storm Gray Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 5775, newused: "Used", vin: "5N1AR18W85C718034", stocknumber: "FAVQ018", model: "Pathfinder", trim: "SE Off Road", enginedescription: nil, interiorcolor: "Graphite", options: "Air Conditioning : Rear A/C,Audio : Cd Player,Convenience : Fog Lamps,Convenience : Luggage Rack,Convenience : Security System,Conven