  Listing.where(title: "2008 Dodge Nitro", description: "Those who enjoy rugged looks, good value, and a capable all-weather vehicle around town will fall in love with our One Owner 2008 Dodge Nitro shown in Inferno Red Crystal Pearl. This mid size SUV is pure Dodge with its distinctive look and Dodge capabilities. Our SLT model comes with loads of power that comes from a reliable 210hp 3.7 Liter V6 and a 4 speed automatic transmission for a peppy, yet smooth ride.  Because of its high stance and truck like frame, the Nitro looks and feels larger than it really is, giving it a solid drive and plenty of cargo and passenger space. This SUV will comfortably seat five passengers, plus the Load N Go Cargo system, and fold flat rear and passenger seats gives you Plenty Of Room for whatever you are hauling!   In crash tests conducted by the National Highway Traffic Safety Administration, this Nitro earned a perfect five stars for all frontal- and side-impact categories. Safe, reliable, luxurious. That's what we call a darn good mix! So- Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2008, miles: 118277, transmission: "Automatic", color: "Inferno Red Crystal Pearl", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 7975, newused: "Used", vin: "1D8GT58K78W114855", stocknumber: "FNSJ168", model: "Nitro", trim: "SLT", enginedescription: nil, interiorcolor: "Dk Slate Gray", options: "Audio : Cd Player,Audio : Mp3 Player,Audio : Satellite Radio,Convenience : Fog Lamps,Convenience : Leather Steering Wheel,Convenience : Power Outlet,Convenience : Steering Wheel Audio Controls,Convenience : Universal Garage Door Opener,Load 