  Listing.where(title: "2012 Chevrolet Impala", description: "Our One Owner, Clean Carfax Chevrolet Impala LT is stunning in Summit White. Our Impala boasts 300 hp 3.6 Liter V6 and scores 30mpg with its smooth shifting 6-Speed automatic transmission. This Impala is equipped with advanced safety systems like Stabilitrack, traction control, anti-lock brakes to make driving simple and safe, and should you have an issue, remember available OnStar automatic crash response.  Whatever your plans are, our Impala with LT trim steps out in style with plenty of room for the important people in your life. Tap the leather-wrapped steering wheel with mounted audio controls and listen to your favorite tunes from available XM radio. Relish the dual-zone temperature, keeping everyone comfortable, and use the versatile flip-and-fold-flat rear seat to handle big purchases. You'll revel in the sunshine and fresh air with the power sunroof in the LT Sunroof Package as well as program 3 remote devices such as garage door openers or your home's outdoor lighting with the included Universal Home Remote.  Give your family the security, performance, and comfort that only come from owning an Impala. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2012, miles: 102535, transmission: "Automatic", color: "Summit White", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 7575, newused: "Used", vin: "2G1WG5E39C1150745", stocknumber: "FCSN128", model: "Impala", trim: "LT Fleet", enginedescription: nil, interiorcolor: "Ebony", options: "Air Conditioning, Dual-Zone Manual Climate Control With Individual Climate Settings For Driver And Right-Front 