  Listing.where(title: "1998 Ford F-150", description: "Our One Owner, Clean Carfax 1998 Ford F-150 XL SuperCab shown in Light Prairie Tan is ready to work for you! Our F-150 boasts a 5.4 Liter V8 connected to an automatic transmission.  Our SuperCab has four doors, so the back seat can be accessed from either side. This is an exceptionally useful feature. Being able to get things into and out of the back seat from either side is tremendously handy. The 60/40, split-folding bottom cushion allows one or both sides to be folded forward, creating a hard, flat load floor for carrying luggage or groceries.  Hardcore truck types may think the F-150's rounded styling is too much like a car, but we like sure like it - and they certainly can't complain about how well this truck works. Built Ford Tough is alive and well in our F150. Print this page and come see us NOW for a personalized test drive towards ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 1998, miles: 100533, transmission: "Automatic", color: "Light Prairie Tan (CC/Met)", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 6775, newused: "Used", vin: "1FTRX17L4WKB49498", stocknumber: "FCSJ108", model: "F-150", trim: "XL", enginedescription: nil, interiorcolor: "Medium Prarie Tan", options: "Audio : Am/Fm Stereo,Auxiliary Pwr Point,Black Door Handles,Chrome Front Bumper,Convenience : Power Outlet,Driver & Front Passenger Air Bags W/Passenger-Side Deactivation Switch,Headliner,Matching Split Bench Rear Seat,Removable Tailgate W/Black Handle,Seat Belts W/Lh Adjustable Shoulder,Seats : Rear Bench Seat,Side Door Intrusion Beams (1997),Steering : Power Steering,Third Door Rear Access For Passengers/Cargo,Vinyl Upper Door Trim W/Integral Armrest