  Listing.where(title: "2004 Toyota Camry Solara", description: "Our One Owner Toyota Camry Solara SE is outstanding in Lunar Mist Metallic. The Front Wheel Drive Solara has a strong 2.4 Liter 4 Cylinder powerhouse under the hood! Not only will this one spoil you with the gorgeous interior, but you'll be passing with complete ease on the open road!  Our Camry Solara was restyled for this model year and Toyota made it larger with a rounder, more aerodynamic shape that is very pleasing to look at. Don't believe me...take a look at our gorgeous pictures of this one. Inside you will find just the right amount of comfort and safety features, including a sunroof!  You really cannot go wrong with our Camry Solara SE! You'll turn heads, love the ride, enjoy the features, and feel safe with every mile! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2004, miles: 113030, transmission: "Automatic", color: "Lunar Mist Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 5775, newused: "Used", vin: "4T1CE30P84U833309", stocknumber: "FCSJ198", model: "Camry Solara", trim: "SE", enginedescription: nil, interiorcolor: "Dark Stone", options: "(2) 12-Volt Auxiliary Pwr Outlets,Audio : Cd Player,Convenience : Power Outlet,Convenience : Steering Wheel Audio Controls,Convenience : Variable Speed Intermittent Wipers,Locks : Keyless Entry,Locks : Power Door Locks,Pwr Windows-Inc: Driver-Side Auto-Up/Down, Retained Pwr Features,Rear Child Restraint System (Crs) Lower Anchors & Top Tether Brackets (Latch),Safety Features : Daytime Running Lights,Seats : Bucket Seats,Seats : Pass-Through Rear Seat,Seats : Rear Bench Seat,Tilt/T