  Listing.where(title: "2007 Jeep Grand Cherokee", description: "It's a Jeep thing. Reliable, dependable, and rugged. Our Clean Carfax 2007 Jeep Grand Cherokee Laredo 4x4 shown in Mineral Gray Metallic retains its classic style and unparalleled off-road ability while delivering a level of luxury not seen in prior year models. This Laredo is brought to life courtesy of a 3.7 Liter 6 Cylinder offering 210hp that is connected to a smooth shifting Automatic transmission. This Four Wheel Drive combination is refined and comfortable enough to drive in the suburbs, this is a must-see!  Our Laredo trim comes with loads of the favorite features you expect; just check out the features list and pictures to see for yourself. Checking out the full power accessories, an excellent audio system with CD, keyless entry, tire pressure monitor, traction control, all-terrain tires, and extra-large cargo area will make you glad you did!   The list of safety equipment on this great SUV is extensive, too. This vehicle will keep you safe and provide maximum luxury while doing so. Seeing is believing and this 2007 Grand Cherokee will make a believer out of you! Print this page and call us Now...We Know You'll Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2007, miles: 126311, transmission: "Automatic", color: "Mineral Gray Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 7775, newused: "Used", vin: "1J8GR48K87C534351", stocknumber: "FCSN208", model: "Grand Cherokee", trim: "Laredo", enginedescription: nil, interiorcolor: "Medium Slate Gray", options: "60/40 Folding Rear Seat,Air Conditioning : A/C,Audio : Cd Player,Convenience : Power Outlet,Convenience : Rear Reading Lamps