  Listing.where(title: "2010 Mercury Mariner", description: "This Clean Carfax 2010 Mariner AWD in Gold Leaf Metallic stands out. It shares its platform with the Ford Escape, and then continues with many mechanical improvements aimed at more power, better fuel economy and better drivability. Under the hood, the 240hp 3.0 Liter V6 is ready to take you wherever you desire.  The interior is filled with features that help reduce road and wind noise. Satin-finish metallic accents and leather heated seats create an upscale ambiance. On board this Premier trimmed SUV, Ford's Sync system, Sunroof and available Satellite Radio are standard. Drivers and passengers alike will be thrilled with all the creature comforts found inside! Inside, storage capabilities are a big plus. In fact, the center console is one of the largest in the class and features removable bins. Generous space is enhanced by a low-level load deck and convenient opening tailgate glass. Cargo volume stands at a useful 29 cubic feet with the rear seat in place and 66 cubic feet when that seat is folded down.   The federal government gives the 2010 Mariner top scores for all seating positions in both frontal and side crash tests. It's also a \"Top Safety Pick\" for its good performance in crash tests and standard electronic stability control. Our Mariner retains the fuel-efficiency, maneuverability and the fun-to-drive nature that is a core characteristic of the small SUV package. If you are shopping this class, it belongs on your short list. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2010, miles: 114209, transmission: "Automatic", color: "Gold Leaf Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 7975, newused: "Used", vin: "4M2CN9HG8AKJ27941", stocknumber: "FCSN218", model: "Mariner", trim: "Premier", enginedescription: nil, interiorcolor: "Cashmere", options: "Audio : Cd Player,Audio : Mp3 Player,Audio : Satellite Radio,Convenience : Cargo Shade,Convenience : Leather Steering Wheel,Convenience : Luggage Rack,Convenience : Power Outlet,Convenience : Steering Wheel Audio Controls,Locks : Keyless Entry,Locks : Power Door Locks,Premium Leather 60/40 Split Rear Bench Seat W/Alcantara Inserts -Inc: Tip-Fold-Flat Latch,Pwr Windows,Seats : Heated Front Seat(S),Seats : Power Driver Seat,Window : Power Windows", imagefront: nil, imageback: nil, imageleft: nil, imageright: nil, frontinterior: nil, rearinterior: nil, bodytype: "SUV", make: "Mercury", approved: true, expiration_date: "2218-01-03 01:44:43", external_url: true, external_image: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/224963/20180623204123720_DSC_0128.jpg", external_imagefront: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/224963/20180623204128380_DSC_0129.jpg", external_imageback: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/224963/20180623204114352_CCF08092017%20-%20Copy.jpg", external_imageleft: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/224963/20180623204119195_DSC_0130.jpg", external_imageright: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/224963/20180623204133539_DSC_0131.jpg", external_frontinterior: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/224963/20180623204144875_DSC_0132.jpg", external_rearinterior: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/224963/20180623204150537_DSC_0133.jpg").first_or_create
  Listing.where(title: "1999 Toyota Camry Solara", description: "The Toyota Solara was introduced in 1999 to provide coupe alternatives to the top-selling Camry sedan. Our One Owner, Clean Carfax Solara SE offers a greater departure from Camry styling and mechanics. While the platform is still the same, the coupe features a sleeker roof line and unique front and rear styling.   This capable 3.0 Liter V6 engine generates 200hp and delivers more than generous fuel efficiency. The cabin is comfortable and well designed with controls that are intuitive and easy to operate, plus it comes with a long list of standard features. Check out our pictures of this beauty and you'll be sold! Thanks to standard safety equipment like 4-wheel ABS, daytime running lights, fog lights, and multiple airbags the Solara earned high marks in government crash tests.  Toyota has excelled at blending a variety of desirable features like safety, comfort, reliability, and refinement into all of their cars, and this Solara is no different. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 1999, miles: 116105, transmission: "Automatic", color: "Black", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 4475, newused: "Used", vin: "2T1CF28P5XC251539", stocknumber: "LCSJ47", model: "Camry Solara", trim: "SE", enginedescription: nil, interiorcolor: "Tan", options: nil, imagefront: nil, imageback: nil, imageleft: nil, imageright: nil, frontinterior: nil, rearinterior: nil, bodytype: "Coupe", make: "Toyota", approved: true, expiration_date: "2218-01-03 01:44:43", external_url: true, external_image: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/224966/20180623204844187_DSC_0093.jpg", external_imagefront: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/224966/20180623204850719_DSC_0094.jpg", external_imageback: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/224966/20180623205141486_CCF08092017%20-%20Copy.jpg", external_imageleft: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/224966/20180623204858249_DSC_0095.jpg", external_imageright: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/224966/20180623204847282_DSC_0096.jpg", external_frontinterior: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/224966/20180623204854361_DSC_0097.jpg", external_rearinterior: "http://images.dealersync.com/cloud/userdocumentprod/2383/Photos/224966/20180623204907739_DSC_0098.jpg").first_or_create
  Listing.where(title: "2006 GMC Yukon Denali", description: "Classy and polished, our 2006 GMC Yukon Denali AWD shown in Sport Red Metallic is sized just right for large families. Powered by a 335hp 6.0 Liter V8, mated with a responsive 4 Speed Automatic transmission, you'll be impressed by its smooth handling, capable ride, and 17mpg on the highway. This All Wheel Drive Denali is ready to take you wherever life leads.  This Denali is loaded with comfort and convenience features galore to make daily driving and long trips enjoyable. Imagine yourself sliding into the heated seats as you adjust the lumbar, bask in the glow of power accessories while you enjoy the sunroof. The passengers in back will love the rear seat audio controls so they can switch through the in-dash CD player, DVD Player or the AM/FM/Satellite radio on the premium sound system.   With an abundance of safety features to keep you and your loved ones safe, you'll sleep better at night knowing you picked an outstanding GMC. A tire-pressure monitor, adjustable pedals, daytime running lights, and a fleet of airbags act as your personal bodyguard. This could be your Yukon! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2006, miles: 159840, transmission: "Automatic", color: "Sport Red Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 8975, newused: "Used", vin: "1GKEK63U96J115429", stocknumber: "FAUN178", model: "Yukon Denali", trim: nil, enginedescription: nil, interiorcolor: "Sandstone", options: "Air Conditioning : Multi-Zone A/C,Audio : Cd Changer,Audio : Premium Sound System,Audio : Rear Seat Audio Controls,Audio : Satellite Radio