  Listing.where(title: "2011 Chevrolet Cruze", description: "Our Clean Carfax 2011 Chevrolet Cruze LS looks dynamite in Black Granite Metallic! The 1.8 Liter 4 Cylinder generates 138hp while paired with a smooth-shifting 6 Speed Automatic. You'll love the athletic handling of this sedan thanks in part to the Z-Link rear suspension that keeps the Cruze composed on the curves, and scoring near 36mpg on the open road isn't bad either!  Take a moment to admire the sporty contours of our Cruze LS, then open the door and you'll be pleasantly surprised at the ample amount of head and legroom. This spacious cabin greets you with supportive seats, a 60/40 split rear seat, a trip computer, full power accessories and a stereo with CD/MP3, and auxiliary jack. This ideal combination of performance, comfort, and convenience features will keep you content and smiling with every drive.  Exude confidence knowing our Cruze's plethora of safety features, such as 10 air bags, steel cabin surround, Panic Brake Assist, StabiliTrak, 4-wheel ABS, and Automatic Crash Response, make it one of the safest autos on the road. This is a superb choice! Give your family the security, performance, and affordability that come with owning a Cruze. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! We are family owned and operated. Our family has been helping people to buy quality used cars for over 30 years.", city: "NOT LISTED", state: "NOT LISTED", zipcode: nil, category_id: nil, subcategory_id: nil, latitude: nil, longitude: nil, user_id: 1072, image: nil, year: 2011, miles: 105938, transmission: "Automatic", color: "Black Granite Metallic", cylinder: "NOT LISTED", fuel: "Gasoline", drive: "2WD", address: nil, wholesale: false, price: 6575, newused: "Used", vin: "1G1PC5SH6B7188614", stocknumber: "FCSJ158", model: "Cruze", trim: "LS", enginedescription: nil, interiorcolor: "Jet Black/Medium Titanium", options: "Air Conditioning, Single-Zone Electronic Includ