  Listing.where(title: "2013 Toyota Prius", description: "We are proud to present our Clean Carfax 2013 Toyota Prius One pictured in sparkling Winter Gray Metallic. Sporting a 1.8 Liter 4 Cylinder with a 60kw electric motor combo tied to a seamless CVT, this car produces 98hp and achieves a great 51mpg in the city. Stellar fuel economy, impressive technology, and a comfortable ride make this an outstanding green choice to help you own your spend. LED running lights and 15 inch aluminum wheels with aerodynamic wheel covers highlight the stylish exterior of Our Prius One. You'll appreciate key-less entry, heated outdoor mirrors and automatic climate control for perfect cabin temperature. Enjoy the convenience of Bluetooth phone and audio connectivity and an audio system with a 6.1-inch display and USB/iPod interface. With latch anchors for child seats and lots of cargo space, you'll have no problem hauling around the family and all of their stuff. Of course, electronic stability control, brake assist, and numerous airbags will keep you and your precious cargo protected. Our Prius excels as a city car, a family car or a let's go buy groceries in bulk kind of car. See what it can do for you! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", city: "PHOENIX", state: "AZ", zipcode: "850086904", category_id: nil, subcategory_id: nil, latitude: 33.699, longitude: -117.777, user_id: 864, image: nil, year: 2013, miles: 79585, transmission: "Variable", color: "Winter Gray Metallic", cylinder: "4", fuel: "Hybrid Fuel", drive: "2WD", address: nil, wholesale: false, price: 12850, newused: "Used", vin: "JTDKN3DU5D1617631", stocknumber: "617631", model: "Prius", trim: "One", enginedescription: "Gas/Electric I4 1.8L/110", interiorcolor: "Dark Gray", options: "Keyless Start,Front Wheel Drive,Power Steering,4-Wheel Disc Brakes,Aluminum Wheels,Wheel Covers,Tires - Front All-Season,Tires - Rear All-Season,Temporary Spare Tire,Rear Spoiler,Automatic Headlights,Power Mirror(s),Intermittent Wipers,Variable Speed Intermittent Wipers,AM/FM Stereo,CD Player,MP3 Player,Auxiliary Audio Input,Cloth Seats,Bucket Seats,Pass-Through Rear Seat,Rear Bench Seat,Adjustable Steering Wheel,Steering Wheel Audio Controls,Trip Computer,Power Windows,Power Door Locks,Keyless Entry,Engine Immobilizer,Climate Control,A/C,Rear Defrost,Power Outlet,Driver Vanity Mirror,Passenger Vanity Mirror,Driver Illuminated Vanity Mirror,Passenger Illuminated Visor Mirror,ABS,Brake Assist,Traction Control,Stability Control,Daytime Running Lights,Driver Air Bag,Passenger Air Bag,Passenger Air Bag Sensor,Front Side Air Bag,Front Head Air Bag,Rear Head Air Bag,Knee Air Bag,Child Safety Locks,Tire Pressure Monitor", imagefront: nil, imageback: nil, imageleft: nil, imageright: nil, frontinterior: nil, rearinterior: nil, bodytype: "Hatchback", make: "Toyota", approved: true, expiration_date: "2218-01-03 01:44:43", external_url: true, external_image: "https://content.homenetiol.com/2001923/2134085/0x0/b01df400e44c4f33b47ec7822a0edc81.jpg", external_imagefront: "https://content.homenetiol.com/2001923/2134085/0x0/41ecb01a2d794f7096b37fc0a1674106.jpg", external_imageback: "https://content.homenetiol.com/2001923/2134085/0x0/a47633d1b77847aebb25278a6c9758c6.jpg", external_imageleft: "https://content.homenetiol.com/2001923/2134085/0x0/0c48f0462e364add8f9de4076b9414be.jpg", external_imageright: "https://content.homenetiol.com/2001923/2134085/0x0/10f6840e80ba4c9c9e117b68eb2a2d19.jpg", external_frontinterior: "https://content.homenetiol.com/2001923/2134085/0x0/4f63ccffcd094d049ede452ef2ee84ba.jpg", external_rearinterior: "https://content.homenetiol.com/2001923/2134085/0x0/f0498a91c42e427e81efe93a0d3fe59e.jpg").first_or_create
  Listing.where(title: "2013 GMC Sierra 2500HD", description: "Our Clean CarFax 2013 GMC Sierra 2500 SLE Crew Cab 4WD, in Red with a Gray interior, offers tremendous capability and control! The 6.0 Liter V8 generates 360hp and 380lb-ft of torque with its heavy duty 6 Speed Automatic transmission. With the included trailering equipment package, you'll find that this Four Wheel Drive provides massive towing/hauling capability and is certainly up to any task! Notice the bold exterior that looks great with a LED cargo box lighting, tow hooks, trailer towing package, a remote locking tailgate and HID projector beam headlamps with LED signature lighting! Our SLE is stronger than ever with two-thirds of the cab structure made of high strength steels.The interior is a fortress of comfort and convenience with everything perfectly in place to help you take command of each day with ease. You'll appreciate power windows/locks, keyless entry, a driver information center, and durable seating. Enjoy your music along the way with our AM/FM/CD/MP3 stereo that features a color touchscreen display, available satellite radio, USB port/auxiliary jack, steering wheel audio controls, Bluetooth, and even OnStar with 4G LTE with available WiFi! Everything you want in a solid truck, our Sierra 2500 lets you feel confident and in control thanks to StabiliTrak with traction control and trailer sway control as well as advanced airbags, daytime running lamps, tire pressure monitoring, and even Teen Driver. Take on your toughest tasks with the precision and powerful performance brought to you by GMC Sierra 2500! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", city: "PHOENIX", state: "AZ", zipcode: "850086904", category_id: nil, subcategory_id: nil, latitude: 33.699, longitude: -117.777, user_id: 864, image: nil, year: 2013, miles: 100159, transmission: "Automatic", color: "Not Specified", cylinder: "8", fuel: "Gasoline Fuel", drive: "2WD", address: