  Listing.where(title: "2011 Ford Super Duty F-250 SRW", description: "Tough and dependable this Clean CarFax 2012 Ford F-250 Lariat Crewcab 4WD, shown in Pale Adobe Metallic with a Tan leather interior, proves why F-Series trucks have been best sellers for decades! Powered by a 6.7 Liter Power Stroke Turbo Diesel V8 that supplies 400hp and teamed with a TorqShift 6 Speed SelectShift Automatic transmission, this Super Duty truck can handle your tough jobs with ease. Work or play you will feel confident with XLT's smooth power and handling. F-250 is built strong with great payload and towing capacity and Four Wheel Drive powers you through difficult terrain. Fog lights, tow hooks, trailer towing package, running boards and a shiny chrome grille/bumper add style. Inside Lariat caters to your comfort with heated and cooled front leather seats, dual climate controls, wood grain trim, keyless entry and an integrated trailer brake controller. Ford Sync w/Sirius allows you hands-free communication and up-to-date info. A power-sliding rear window and power telescoping mirrors are nice extras and you will love the roomy 2nd seat. Safety is always number one with Ford and the F-250 is at the top. Six standard airbags, SOS post-crash alert and Roll Stability Control keep you safe and secure. The Ford F-250 4x2 is an impressive, powerful choice. You will love getting behind the wheel of this Ford Tough Truck! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership. .", city: "PHOENIX", state: "AZ", zipcode: "850086904", category_id: nil, subcategory_id: nil, latitude: 33.699, longitude: -117.777, user_id: 864, image: nil, year: 2011, miles: 107416, transmission: "Automatic", color: "Not Specified", cylinder: "8", fuel: "Diesel Fuel", drive: "2WD", address: nil, wholesale: false, price: 37900, newused: "Used", vin: "1FT7W2BT1BEA62691", stocknumber: "A62691", model: "Super Duty F-250 SRW", trim: "Lariat", enginedescription: "Turbocharged Diesel