  Listing.where(title: "2015 Chevrolet Spark", description: "Our Clean CarFax 2015 Chevrolet Spark 1LT Hatchback, shown in zesty Denim Metallic, delivers the vivid color, flowing lines, and classy headlamps that draw positive attention at every turn. Our bold Front Wheel Drive is powered by GM's proven 1.2 Liter 4 Cylinder that offers a peppy 84hp and is mated to a CVT Automatic transmission that tallies up 39mpg on the highway. Spark is ready for fast-moving, bumper to urban bumper driving as well as for a road trip with its ultra-comfortable ride. The exterior is highlighted with alloy wheels and a rear spoiler. Our 1LT Spark sedan leads the way with a long list of amenities, such as MyLink Touch Radio, six premium speakers, XM and cruise control, Inside, this machine is incredibly roomy, allowing two adults to sit in the back with its extra headroom comfortably. Plus, our Spark offers twice the cargo room of its closest competitor! Check out our pictures and imagine yourself behind the wheel as the proud new owner. Our roomy Spark keeps safety at the top of the list with features like ten airbags, ABS, hill assist start, and stability control. With sizzling style and significant street smarts, this car packs a punch that will leave you smiling! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", city: "PHOENIX", state: "AZ", zipcode: "850086904", category_id: nil, subcategory_id: nil, latitude: 33.699, longitude: -117.777, user_id: 864, image: nil, year: 2015, miles: 81057, transmission: "Automatic", color: "Denim", cylinder: "4", fuel: "Gasoline Fuel", drive: "2WD", address: nil, wholesale: false, price: 7950, newused: "Used", vin: "KL8CD6S90FC718101", stocknumber: "718101", model: "Spark", trim: "LT", enginedescription: "Gas I4 1.2L/76", interiorcolor: "Silver w/Blue trim", options: "SILVER W/BLUE TRIM  CLOTH SEAT TRIM,CHEVROLET MYLINK RADIO  AM/FM STEREO WITH SEEK-AND-SCAN AND DIGITAL CLOCK  includes Bluetooth strea