  Listing.where(title: "2015 Kia Sedona", description: "Your modern family deserves to arrive in style courtesy of our One Owner, Clean CarFax 2015 Kia Sedona LX Minivan dressed in a beautiful Bright Silver paint scheme. This lounge on the go vehicle is powered by a proven 3.3 Liter V6 that puts 276hp under your command via a smooth shifting 6 Speed Automatic transmission with Front Wheel Drive. Your reward behind the wheel is a confident, quiet ride that is poised and comfortable while providing you with near 24mpg on the open road. Our Sedona LX stands out in a sea of bland minivans with its striking stance that perfectly blends classic proportions with a sporty demeanor. You'll love the distinct grille, alloy wheels, rear spoiler and projector beam headlights! Versatile and comfortable, the interior greets you with YES Essentials Fabric which is pretreated to repel stains, prevent static and eliminate odors. Other conveniences include a UVO eService Infotainment system, stowable 3rd-row seat, dual sliding rear doors, keyless entry and slide-n-stow 2nd-row seats. Because your precious cargo is important to the engineers at Kia, our Sedona has been carefully constructed with a plethora of airbags, rollover mitigation, stability control, traction control, ABS, side-impact door beams and other advanced safety features. Inject some style and life back into your daily routine with this bold new Sedona! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", city: "PHOENIX", state: "AZ", zipcode: "850086904", category_id: nil, subcategory_id: nil, latitude: 33.699, longitude: -117.777, user_id: 864, image: nil, year: 2015, miles: 45492, transmission: "Automatic", color: "Bright Silver", cylinder: "6", fuel: "Gasoline Fuel", drive: "2WD", address: nil, wholesale: false, price: 17975, newused: "Used", vin: "KNDMB5C18F6045075", stocknumber: "45075", model: "Sedona", trim: "LX", enginedescription: "Regular Unleaded V-6 3.3 L/204", in