  Listing.where(title: "2014 Hyundai Sonata", description: "Sculpted in a beautiful Radiant Silver paint scheme, is our Clean CarFax 2014 Hyundai Sonata SE Sedan. From the sculpted grille to the raked roofline, Hyundai's signature design has created a family sedan that has won the hearts of people around the world. Under the hood sits our Turbo Charged 2.0 Liter 4 Cylinder that produces a healthy 274hp and is paired with quick shifting 6 Speed Automatic transmission and Front Wheel Drive that can achieve near 32mpg on the open road. On the outside, this SE includes distinctive alloy wheels, fog lights, and dual exhaust. Our pictures display an interior that would make anyone feel at home. The roomy, well-built cabin provides more interior room and a more significant trunk than many of its closest competitors without cramping your lifestyle.Step inside, and you'll be greeted by bolstered sport seats, Hyundai's incredibly intuitive Blue Link telematics system, and keyless entry. The Sonata has received a 2012 Top Safety Pick award from the IIHS as well as a 5-star overall crash rating by the NHTSA, the first midsize car to do so under the federal governments more stringent guidelines. It's time to reward yourself by driving a family sedan that doesn't scream boring. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", city: "PHOENIX", state: "AZ", zipcode: "850086904", category_id: nil, subcategory_id: nil, latitude: 33.699, longitude: -117.777, user_id: 864, image: nil, year: 2014, miles: 49657, transmission: "Automatic", color: "Radiant Silver Metallic", cylinder: "4", fuel: "Gasoline Fuel", drive: "2WD", address: nil, wholesale: false, price: 16750, newused: "Used", vin: "5NPEC4AB8EH846682", stocknumber: "846682", model: "Sonata", trim: "Limited", enginedescription: "Intercooled Turbo Regular Unleaded I-4 2.0 L/122", interiorcolor: "Gray", options: "RADIANT SILVER METALLIC,CARPETED FLOOR MATS,WHEEL LOCKS,OPTION GROUP 1,CA