  Listing.where(title: "2013 Ford F-150", description: "Meet our One Owner 2013 Ford F-150 XL SuperCrew 4x4 shown in brilliant Tuxedo Black. This handsome truck starts with a get it done attitude. A Twin Turbo 3.5 Liter EcoBoost V6 that offers 365hp on demand while paired with a 6 Speed Automatic w/Tow/Haul Mode you will have no problem pulling in up to 22mpg while enjoying a smooth and quiet ride. Our Ford Tough F-150 is one of the top selling full-size trucks on the market today due to it's reliability and performance. Best in class in towing and payload capabilities make this functional but it's a darn good looking truck too! Who would have thought Turbo and 4x4 went together like this. Ford has a winner here! Inside you can expect the same durability and style with SuperCrew. You will find comfortable seating for your crew with an easy to read display center and great storage spaces. With this XL, you are good to go with a superb, reliable truck for a great price! Did you see the sunroof? Ford always comes through with safety and F-150 ranks at the top. It's high strength steel safety cage keeps you secure along with six standard airbags, SOS post crash Alert, Trailer Sway and Roll Stability control and anti-lock brakes. F-150 has everything you could ask for in a full-size truck. Whether it's for work or play you have made an excellent choice! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", city: "PHOENIX", state: "AZ", zipcode: "850086904", category_id: nil, subcategory_id: nil, latitude: 33.699, longitude: -117.777, user_id: 864, image: nil, year: 2013, miles: 88953, transmission: "Automatic", color: "Tuxedo Black Metallic", cylinder: "6", fuel: "Gasoline Fuel", drive: "2WD", address: nil, wholesale: false, price: 30850, newused: "Used", vin: "1FTFW1ET8DKE56386", stocknumber: "E56386", model: "F-150", trim: "Lariat", enginedescription: "Turbocharged Gas V6 3.5L/213", interiorcolor: "Pecan w/Black Interior", opt