  Listing.where(title: "2014 Toyota Tundra 4WD Truck", description: "Every road leads to adventure in our One Owner Clean Carfax 2014 Toyota Tundra SR5 Crew Max 4WD presented here in Radiant Red. The 5.7 Liter V8 powerhouse under the bold new hood provides all the muscle you need, churning out 381hp on demand and tethered to a smooth 6 Speed automatic. This team provides you with 18mpg hwy and acceleration that will get your blood pumping. Whether you're tackling trails or gliding down the freeway, this truck exudes capability, style and strength with off-road capability and Four Wheel Drive prowess. Redesigned for 2014, the masculine charm of our SR5 is highlighted by an integrated hood and chrome grille, 18' alloy wheels, and off-road tires. You'll also appreciate skid plates, front tow hooks and Bilstein shocks. Premium materials on stylish gauges, practical buttons and knobs are refreshingly easy to use and add to the ergonomic design and craftsmanship of the cabin. Bluetooth connectivity, a convenient touchscreen display and satellite radio keep you connected and entertained so you can get your job done in comfort and style. Just try to suppress the smile on your face as this truck works smoothly through its gears propelling you down the road while turning heads. Built in the U.S.A, this truck leads the pack in safety thanks to intelligently designed ABS, stability/ traction control, trailer sway control, and numerous airbags. You deserve an attractive truck that works hard so you can play harder. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", city: "PHOENIX", state: "AZ", zipcode: "850086904", category_id: nil, subcategory_id: nil, latitude: 33.699, longitude: -117.777, user_id: 864, image: nil, year: 2014, miles: 30989, transmission: "Automatic", color: "Radiant Red", cylinder: "8", fuel: "Gasoline Fuel", drive: "2WD", address: nil, wholesale: false, price: 34850, newused: "Used", vin: "5TFDW5F19EX347810", sto