  Listing.where(title: "2012 Ford Super Duty F-350 SRW", description: "This sharp One Owner Clean Carfax 2012 Ford F-350 XL Crew Cab 4x4 shown in Oxford White Clearcoat is powerful and ready to work for you! This workhorse is powered by a 6.7 Liter Power Stroke Turbo Diesel V8 that offers 400hp on demand while paired with a TorqShift 6 Speed SelectShift Automatic. F-350 can handle your toughest job with ease and efficiency and 4x4 powers you through any road condition. This truck is built strong with great payload and towing capacity up to 22,700 lbs. The F-Series line has been top selling for decades and it's easy to see why! Inside you will find easy to use controls and comfortable features. A 40/20/40 split front bench w/ locking bin and vinyl upholstery, vinyl flooring, tilt and telescoping steering wheel and AM/FM 2 speaker stereo come standard. Everything you need is at your fingertips in the great practical truck. Safety is always number one with Ford and the F-350 is at the top. Six standard airbags, SOS post-crash alert and Roll Stability Control keep you safe and secure. The Ford F-350 4x4 is an impressive, powerful choice. You will love getting behind the wheel of this fantastic Ford Tough Truck! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", city: "PHOENIX", state: "AZ", zipcode: "850086904", category_id: nil, subcategory_id: nil, latitude: 33.699, longitude: -117.777, user_id: 864, image: nil, year: 2012, miles: 112569, transmission: "Automatic", color: "Oxford White", cylinder: "8", fuel: "Diesel Fuel", drive: "2WD", address: nil, wholesale: false, price: 29950, newused: "Used", vin: "1FT8W3BT1CEA22736", stocknumber: "A22736", model: "Super Duty F-350 SRW", trim: "XL", enginedescription: "Turbocharged Diesel V8 6.7L/406", interiorcolor: "Steel", options: "6.7L 32-VALVE PWR STROKE V8 TURBO DIESEL ENGINE  -inc: 750 CCA 78-AH dual batteries  intelligent oil life minder  14K trailer hitch receiver w/2.5 tra