  Listing.where(title: "2015 Ford Focus", description: "Our One Owner Clean Carfax 2015 Ford Focus SE Hatchback in Oxford White offers impressive handling, efficiency and absolute comfort! You will certainly be impressed with the crisp punch this 160hp 2.0 Liter 4 Cylinder delivers. The fun-to-drive 6 Speed Manual transmission with start/stop makes for an enjoyable ride that pulls in up to 36mpg! Whether you're headed to work or play, the Focus SE is just simply a joy to drive! You'll love the modern look with 16 inch wheels and automatic quad beam headlights! Everything was designed with the driver in mind from a trip computer, power accessories, rear view camera, front center storage console and plenty of head and leg room. You'll also appreciate MyKey and the SYNC voice-activated phone and audio player interface with Bluetooth, a six-speaker sound system, steering-wheel mounted audio controls, CD player and auxiliary audio jack. This hatchback has plenty of cargo space to keep your active lifestyle on the go with you. The Ford Focus has a great reputation for safety! Six standard airbags, electronic stability control, anti-lock brakes and tire pressure monitoring all ensure the safest ride possible. The Focus offers everything you need for a stylish, fun, safe and economical ride. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", city: "PHOENIX", state: "AZ", zipcode: "850086904", category_id: nil, subcategory_id: nil, latitude: 33.699, longitude: -117.777, user_id: 864, image: nil, year: 2015, miles: 48779, transmission: "Manual", color: "Oxford White", cylinder: "3", fuel: "Gasoline Fuel", drive: "2WD", address: nil, wholesale: false, price: 10500, newused: "Used", vin: "1FADP3KE8FL211113", stocknumber: "211113", model: "Focus", trim: "SE", enginedescription: "Intercooled Turbo Regular Unleaded I-3 1.0 L/61", interiorcolor: "Charcoal Black", options: "ENGINE: 1.0L ECOBOOST  -inc: Start-Stop  Transmission: 6-Speed M