  Listing.where(title: "2017 Chevrolet Impala", description: "Our great looking One Owner Clean Carfax 2017 Chevrolet Impala LT Sedan is raising the bar yet again while shown in Summit White! Fueled by a proven 3.6 Liter Direct Injected V6 that offers 305hp while paired with a 6 Speed Automatic transmission. Our Front Wheel Drive sedan rewards you with aggressive performance and incredible efficiency of near 28mpg on the highway. It's no surprise it was named Best Large Car for the Money by U.S. News and World Report! Our Impala LT boasts an athletic stance that you can't help but notice. Inside you'll discover enough space to seat five adults so you and your passengers can ride in comfort. Appreciate cloth and leatherette seating, dual-zone automatic climate control, a leather-wrapped steering wheel, an eight-way power adjustable driver seat and a trip computer. Stay effortlessly connected thanks in part to the MyLink Infotainment system, prominent touchscreen, voice controls, OnStar with available WiFi, Bluetooth, and a great sound system with available satellite radio, an SD card slot, HD radio, Apple CarPlay, and Android Auto smartphone integration. Enjoy a sterling reputation from Chevrolet for reliability and safety with anti-lock brakes, traction/stability control, advanced airbags, as well as OnStar's available automatic crash notification and emergency assistance. With ample passenger and trunk space, a wealth of amenities, and award-winning performance, our Impala is the smart choice you'll love for years to come! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", city: "PHOENIX", state: "AZ", zipcode: "850086904", category_id: nil, subcategory_id: nil, latitude: 33.699, longitude: -117.777, user_id: 864, image: nil, year: 2017, miles: 43213, transmission: "Automatic", color: "Summit White", cylinder: "6", fuel: "Flex Fuel", drive: "2WD", address: nil, wholesale: false, price: 18950, newused: "Used", vin: "2G11