  Listing.where(title: "2014 Chevrolet Silverado 1500", description: "Conquer the road in our legendary One Owner Clean Carfax 2014 Chevrolet Silverado 1500 Crew Cab LTZ 4x4 decked out in handsome Blue Granite Metallic. Powered by a 5.3 Liter V8 that offers 355hp while connected to a 6 Speed Automatic transmission for astonishing towing and passing authority. Muddy rural roads, mountain terrain, towing your boat, or hauling lumber are no challenge for our Four Wheel Drive Silverado that helps you see near 23mpg. The front suspension eases you down the road in comfort while the rear set up is tough enough to keep up with your demanding life. The commanding appearance of this Silverado Crew Cab LTZ with its alloy wheels improves any landscape. The upscale LTZ interior features an exclusive dash design with wood and metallic accents, leather, heated front bucket seats and driver-seat memory settings. MyLink, a central display, Bluetooth, and a Bose audio system with a six-disc CD changer, a USB/iPod interface and rear audio controls keeps you connected and entertained along the way. Well-known GM safety features are in a place like Stabilitrak, 4-wheel ABS, daytime running lamps, and plenty of airbags. This no-nonsense truck will make sure it fulfills your needs for work and play. Get the job done right with the security, performance, and comfort that only come from the Silverado. Don't delay! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", city: "PHOENIX", state: "AZ", zipcode: "850086904", category_id: nil, subcategory_id: nil, latitude: 33.699, longitude: -117.777, user_id: 864, image: nil, year: 2014, miles: 64830, transmission: "Automatic", color: "Blue Granite Metallic", cylinder: "8", fuel: "Flex Fuel", drive: "2WD", address: nil, wholesale: false, price: 33850, newused: "Used", vin: "3GCUKSEC7EG437636", stocknumber: "437636", model: "Silverado 1500", trim: "LTZ", enginedescription: "Gas/Ethanol V8 5.3L/325", inte