  Listing.where(title: "2014 Ford Focus", description: "Meet our One Owner Clean Carfax 2014 Ford Focus SE sedan viewed in Ingot Silver Metallic. Take in the lean lines and smart styling then prepare to be impressed with the crisp punch of this 2.0 Liter. It offers 160hp on demand while sipping on Flex Fuel or unleaded and while connected to a quick shifting 5 Speed Manual, you will enjoy near 36mpg. With less trips to the gas pump you will have more time and money for the good things in life! Driving the Focus SE is pure enjoyment when you have amenities such as Ford Sync on-board. Voice-activated phone and stereo controls ensure your hands are on the wheel and eyes on the road. Combine the superb 6 speaker stereo system, comfortable seats, power windows and locks, tilt and telescoping steering wheel, a handy front center storage console and you are riding in style. Ford always strives to make your ride one of the safest on the road and once again they stepped up to the plate providing six standard airbags, electronic stability control, anti-lock brakes and tire pressure monitoring that all ensure the safest ride possible. It's no surprise the 2014 Ford Focus earned 5 stars on the national safety ratings. MyKey technology allows parents to designate a key that will operate special features such as speed and audio volume to ensure safe teen driving. You can't go wrong with a Ford Focus! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", city: "PHOENIX", state: "AZ", zipcode: "850086904", category_id: nil, subcategory_id: nil, latitude: 33.699, longitude: -117.777, user_id: 864, image: nil, year: 2014, miles: 51999, transmission: "Automatic", color: "Ingot Silver Metallic", cylinder: "4", fuel: "Gasoline Fuel", drive: "2WD", address: nil, wholesale: false, price: 9850, newused: "Used", vin: "1FADP3F24EL219398", stocknumber: "219398", model: "Focus", trim: "SE", enginedescription: "Regular Unleaded I-4 2.0 L/122", interior