  Listing.where(title: "2013 Ford Explorer", description: "Our athletic One Owner, Clean Carfax 2013 Ford Explorer Sport AWD displayed in beautiful Ruby Red Tinted Clearcoat is waiting for you! This 7 passenger SUV is powered by an incredible TurboCharged 3.5 Liter EcoBoost V6 that offers 350hp on demand while tethered to a smooth shifting 6 Speed SelectShift Automatic transmission for amazing passing power. This All Wheel Drive Sport can help you secure near 22mpg. You'll be ready for all road conditions and this bold design turns heads with its chrome accents, streamlined body colored molding and overall handsome style. Projector beam headlights and LED taillights set the stage while unique 20-inch wheels enhance the view. Look inside and see premium features everywhere like a dual-panel sunroof, full-color navigation, and a backup camera. MyFord Touch with Sony Audio offers the latest news, weather, and tunes with media hub. You'll have plenty of power points to keep everyone in the family plugged in. Rear climate control and dual screen DVD system to keep the passengers happy! Superb lighting and storage options make this Sport just right for your family's needs. This SUV from Ford is unparalleled in safety with airbags, SOS post-crash alert, tire pressure monitoring, reverse sensing system and traction control. MyKey even allows you to set controls such as speed and volume for young drivers. Get behind the wheel to see what The Sport can do for you! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", city: "PHOENIX", state: "AZ", zipcode: "850086904", category_id: nil, subcategory_id: nil, latitude: 33.699, longitude: -117.777, user_id: 864, image: nil, year: 2013, miles: 85542, transmission: "Automatic", color: "Ruby Red Metallic Tinted Clearcoat", cylinder: "6", fuel: "Gasoline Fuel", drive: "2WD", address: nil, wholesale: false, price: 21950, newused: "Used", vin: "1FM5K8GT9DGC49422", stocknumber: "C49422", model: