  Listing.where(title: "2010 Chevrolet Camaro", description: "Feast your eyes on our Clean Carfax 2010 Chevrolet Camaro 2LT in eye-catching Aqua Blue Metallic! This rival to the pony is motivated by the feisty 3.6 Liter V6 that unleashes a healthy 300hp while perfectly paired with an innovative 6 Speed Automatic transmission with manual shift control. You'll enjoy impressive acceleration and score near 30mpg on the open road. It is your time to tone up to the muscle car! The unique stance of our Camaro is enhanced by 19-inch alloy wheels. Inside, you'll be more than impressed by a wealth of amenities including supple leather heated front power seats, and a fantastic sound system with steering wheel mounted controls, a USB audio interface, and Bluetooth. Designed for those who love to drive, our Camaro exhibits finesse and style on the road thanks to an unparalleled combination of power, grip, and quality! You've got to see this machine in the flesh! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", city: "PHOENIX", state: "AZ", zipcode: "850086904", category_id: nil, subcategory_id: nil, latitude: 33.699, longitude: -117.777, user_id: 864, image: nil, year: 2010, miles: 135729, transmission: "Automatic", color: "Aqua Blue Metallic", cylinder: "6", fuel: "Gasoline Fuel", drive: "2WD", address: nil, wholesale: false, price: 9950, newused: "Used", vin: "2G1FC1EV1A9161484", stocknumber: "161484", model: "Camaro", trim: "2LT", enginedescription: "Gas V6 3.6L/220", interiorcolor: "Gray", options: "PREFERRED EQUIPMENT GROUP  includes Standard Equipment,REMOTE VEHICLE STARTER SYSTEM  includes Remote Keyless Entry,ENGINE  3.6L VARIABLE VALVE TIMING V6 WITH SIDI (SPARK IGNITION DIRECT INJECTION)  (304 hp [226.7 kW] @ 6400 rpm  273 lb-ft of torque [368.6 N-m] @ 5200 rpm) (STD),AQUA BLUE METALLIC,TIRES  P245/45R20 FRONT AND P275/40R20 REAR  BLACKWALL  SUMMER,WHEELS  20 X 8 (50.8 CM X 20.3 CM) FRONT AND 20 X 9 (50.8 CM X 22.9 CM) RE