  Listing.where(title: "2015 Volkswagen Jetta Sedan", description: "Ready to roll, our One Owner 2015 Volkswagen Jetta S looks great in Pure White! At the heart of our Jetta is a spirited 2.0 Liter 4 Cylinder that offers 115hp on demand and near 30mpg; proving that driving pleasure doesn't have to cost you at the pump! This Front Wheel Drive power is harnessed with responsive 6 Speed Automatic that adds a sports car feel to a sedan. Agile suspension, powerful brakes, and a feeling of flat-out fun best describe this Jetta. The streamlined, classic design of our Jetta S is enhanced by a new front grille, heated side mirrors and other new features for optimal aerodynamics. Inside the modern and spacious interior you'll find that the seats are especially supportive and power windows/locks, air-conditioning, a trip computer and key-less entry are handy as well! Just imagine yourself behind the wheel of this charming sedan listening to your favorite songs on a great sound system with a CD player and auxiliary audio jack... Now just try to suppress a smile! Safety features on this machine are amazing. With strengthened pillars and door sills as well as six airbags, Intelligent Crash Response System, ABS w/Electronic Stability Control and more, our 2015 is a Top Safety Pick! Reward yourself with this Jetta and make each commute more exciting! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", city: "PHOENIX", state: "AZ", zipcode: "850086904", category_id: nil, subcategory_id: nil, latitude: 33.699, longitude: -117.777, user_id: 864, image: nil, year: 2015, miles: 97235, transmission: "Automatic", color: "Pure White", cylinder: "4", fuel: "Gasoline Fuel", drive: "2WD", address: nil, wholesale: false, price: 8550, newused: "Used", vin: "3VW2K7AJ0FM250988", stocknumber: "250988", model: "Jetta Sedan", trim: "2.0L S", enginedescription: "Regular Unleaded I-4 2.0 L/121", interiorcolor: "2-Tone Ceramique/Black", options: "Front Wheel