  Listing.where(title: "2015 Volkswagen Jetta Sedan", description: "Meet our incredible One Owner, Clean Carfax 2015 Volkswagen Jetta TDI S Sedan brought to you in Silk Blue Metallic! At the heart of our sedan is a TurboCharged 2.0 Liter 4 Cylinder Diesel that offers 150hp on while connected quick-shifting 6 Speed Automated Manual gearbox that adds a sports car feel to a vehicle. Agile suspension, powerful brakes, and a feeling of flat-out fun best describe this Jetta. The streamlined, classic design of our Jetta TDI S is enhanced by a unique front grille, alloy wheels, heated side mirrors and other innovative features for optimal aerodynamics. Inside the modern and spacious interior, find a wealth of amenities including power adjustable heated seats with premium cloth and a leather-wrapped multi-function steering wheel. You'll also appreciate Bluetooth phone and audio connectivity and a sound system with satellite radio, iPod interface, and CD player. Safety features on this Volkswagen are amazing. With strengthened pillars and door sills as well as six airbags, Intelligent Crash Response System, ABS w/Electronic Stability Control and more, our 2015 Jetta is a Top Safety Pick! Reward yourself with this Jetta and make each commute more exciting! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", city: "PHOENIX", state: "AZ", zipcode: "850086904", category_id: nil, subcategory_id: nil, latitude: 33.699, longitude: -117.777, user_id: 864, image: nil, year: 2015, miles: 40081, transmission: "Automatic", color: "Silk Blue Metallic", cylinder: "4", fuel: "Diesel Fuel", drive: "2WD", address: nil, wholesale: false, price: 13850, newused: "Used", vin: "3VWLA7AJ7FM238750", stocknumber: "238750", model: "Jetta Sedan", trim: "2.0L TDI S", enginedescription: "Intercooled Turbo Diesel I-4 2.0 L/120", interiorcolor: "Titan Black", options: "Turbocharged,Front Wheel Drive,Power Steering,ABS,4-Wheel Disc Brakes,Brake Assist,Wheel Cover