  Listing.where(title: "2014 Mercedes-Benz C-Class", description: "You will love our beautiful Clean Carfax 2014 Mercedes-Benz C250 Sport Sedan in Lunar Blue Metallic. Fueled by a TurboCharged 1.8 Liter 4 Cylinder that offers 201hp while connected to a 7 Speed Automatic transmission with touch shift. This Rear Wheel Drive C Class maintains composure, soaring to 60mph in just over 7 seconds with fantastic driving dynamics as well as a smooth 31mpg on the open road. Distinctly debonair, this C250 Sport Sedan is unmatched in innovation and refinement. Enjoy its stylish and sporty ambiance that is enhanced with attractive, alloy wheels, LED running lamps, and automatic headlights. Inside, you'll love the auto-dimming rearview mirror, sunroof, dual-zone electronic climate control, and premium leather ultra-supportive heated front seats. Take your connectivity to the next level with our COMAND interface that features smartphone integration, Bluetooth connectivity, and a fantastic audio system. In classic Mercedes-Benz fashion, this C250 is equipped with carefully crafted features including anti-lock brakes, stability/traction control, advanced airbags, mbrace2 emergency communications, and Attention Assist. Reward yourself with the pleasure that comes from Mercedes-Benz craftsmanship. Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", city: "PHOENIX", state: "AZ", zipcode: "850086904", category_id: nil, subcategory_id: nil, latitude: 33.699, longitude: -117.777, user_id: 864, image: nil, year: 2014, miles: 52786, transmission: "Automatic", color: "Lunar Blue Metallic", cylinder: "4", fuel: "Gasoline Fuel", drive: "2WD", address: nil, wholesale: false, price: 17350, newused: "Used", vin: "WDDGF4HB4EG228811", stocknumber: "228811", model: "C-Class", trim: "Sport Sedan", enginedescription: "Intercooled Turbo Premium Unleaded I-4 1.8 L/110", interiorcolor: "Black", options: "Turbocharged,Rear Wheel Drive,Power Steering,ABS,4-Wheel