  Listing.where(title: "2015 GMC Sierra 2500HD", description: "Redesigned for 2015, our Clean Carfax GMC Sierra 2500 SLT Crew Cab 4WD displayed in handsome Summit White offers more features, more comfort and even more capability than ever before! Powering this strong truck is a brawny 6.0 Liter V8 that cranks out a healthy 360hp and 380 pound-feet of torque. Perfectly matched to a durable 6 Speed automatic transmission and with the included heavy-duty trailering package, this Four Wheel Drive Sierra can haul up to 3,760 pounds, tow up to 13,000 pounds and 17,900 pounds with a fifth wheel hitch. You'll also be surprised at the impressive acceleration for when it's time to get up and go! Our heavy duty SLT commands respect with chrome bumpers, foglights, and 18 inch alloy wheels. Climb inside, and prepare to tackle your job in style and comfort with heated power-adjustable leather seats, a rearview camera, full power accessories and a 110 volt power point. You'll appreciate a large touchscreen with the GMC IntelliLink interface, smartphone integration, Bluetooth phone and audio connectivity, voice controls and a great audio system with a CD player and available satellite radio. Safety will not be a concern as you feel confident with antilock disc brakes, traction and stability control with trailer sway control, front-seat side airbags and full-length side curtain airbags. For added peace of mind, available OnStar with automatic crash notification, on-demand roadside assistance, remote door unlocking, stolen-vehicle assistance and turn-by-turn navigation is also included. Get behind the wheel! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", city: "PHOENIX", state: "AZ", zipcode: "850086904", category_id: nil, subcategory_id: nil, latitude: 33.699, longitude: -117.777, user_id: 864, image: nil, year: 2015, miles: 96852, transmission: "Automatic", color: "Summit White", cylinder: "8", fuel: "Flex Fuel", drive: "2WD", addre