  Listing.where(title: "2017 Toyota 4Runner", description: "Thrive on the versatility of our One Owner, Clean Carfax 2017 Toyota 4Runner SR5 4WD that's ruggedly handsome in Classic Silver Metallic! Powered by a 4.0 Liter V6 that offers 270hp while connected to a 5 Speed Automatic transmission for easy passing or towing maneuvers. Our Four Wheel Drive 4Runner has impressive ground clearance and handles with precision and control with a smooth ride and offers near 22mpg on the open road. SR5 has been thoughtfully designed with your needs in mind. Check out the alloy wheels, projector beam headlights, and skid plates! The SR5 cabin brings comfort and convenience to each day with supportive seats, a leather-wrapped steering wheel, Bluetooth hands-free phone and voice command. Enjoy Entune Audio Plus with Connected Navigation App featuring a high-resolution touchscreen and available HD/satellite radio. In the rear, a 40/20/40 split seat offers versatility and reclines for additional comfort. Whatever your adventure, you'll be prepared and safe with anti-lock brakes, a backup camera, airbags and other advanced safety features. A unique blend of utility, dependability, capability and bold style, this 4Runner is an ideal choice for your active lifestyle! Print this page and call us Now... We Know You Will Enjoy Your Test Drive Towards Ownership! .", city: "PHOENIX", state: "AZ", zipcode: "850086904", category_id: nil, subcategory_id: nil, latitude: 33.699, longitude: -117.777, user_id: 864, image: nil, year: 2017, miles: 30270, transmission: "Automatic", color: "Classic Silver Metallic", cylinder: "6", fuel: "Gasoline Fuel", drive: "2WD", address: nil, wholesale: false, price: 34850, newused: "Used", vin: "JTEBU5JR2H5442389", stocknumber: "442389", model: "4Runner", trim: "SR5", enginedescription: "Regular Unleaded V-6 4.0 L/241", interiorcolor: "Black/Graphite", options: "Four Wheel Drive,Tow Hitch,Power Steering,ABS,4-Wheel Disc Brakes,Brake Assist,Aluminum Wheels,Tires -